import React from "react";
import "./FuncCard.css"

let FuncCard =(props) => {
    return(
        <div>
           <div className="card">
               <div className="card-body">
                   <h3>React-JS {props.info}{props.employee[0]}</h3>
                   <p>{new Date().toLocaleDateString()}</p>
                   <p>{new Date().toLocaleTimeString()}</p>
                   <h5>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Aut eius enim, explicabo fuga itaque laudantium libero minus neque nostrum pariatur porro qui saepe, similique sint suscipit tenetur totam vel voluptatem!</h5>

               </div>
           </div>
        </div>
    );


};

export default FuncCard;
